window.bookSummaryJSON = "<p>Rogue Protocol is the third entry in Martha Wells's Hugo, Nebula, Alex, and Locus Award-winning, New York Times and USA Today bestselling series, The Murderbot Diaries.</p> <p>Starring a human-like android who keeps getting sucked back into adventure after adventure, though it just wants to be left alone, away from humanity and small talk.</p> <p>Who knew being a heartless killing machine would present so many moral dilemmas?</p> <p>Sci-fi’s favorite antisocial A.I. is back on a mission. The case against the too-big-to-fail GrayCris Corporation is floundering, and more importantly, authorities are beginning to ask more questions about where Dr. Mensah's SecUnit is.</p> <p>And Murderbot would rather those questions went away. For good.</p> <p>Performed by David Cui Cui, Julienne Irons, Natalie Van Sistine, Alejandro Ruiz, Alysia Beltran, Bradley Foster Smith, Elena Anderson, Eric Messner, Jenna Sharpe, Khaya Fraites, Marni Penning, Michael John Casey, Scott McCormick, and Yasmin Tuazon.</p>"; 
